import React from 'react';

import './TopTabs.css';

const TopTabs = () => {
  return (
      <div className="tabs">
        <button className="tab">Levels</button>
        <button className="tab">Challenges</button>
        <button className="tab">Quests</button>
      {/* <div className="challenges">
        Challenges Content
      </div> */}
    </div>


  );
};

export default TopTabs
